import Chart from "chart.js"

const stackedBar = new Chart(ctx, {
    type: 'bar',
    data: [[5,6], [-3,-6]],
    options: {
        scales: {
            xAxes: [{
                stacked: true
            }],
            yAxes: [{
                stacked: true
            }]
        }
    }
});

export default stackedBar
